import React from "react";



export default function ConfirmDelete({ text, acceptText, cancelText, acceptPopUp, cancelPopUp,thirdOptionText,thirdOption }) {

  return (
    <div>
      <p>{text}</p>
      <button onClick={acceptPopUp}>yes</button>
      <button onClick={cancelPopUp}>no</button>
      
    </div>
  );
}
